SET IDENTITY_INSERT [dbo].[Analisis] ON 

INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (1, N'Logoaudiometria', N'Prueba en la que se utilizan palabras para determinar la funcionalidad del sistema auditivo. ', N'- El paciente no debe tener cuadro de Infección de vías respiratorias superiores.
- Otitis media aguda durante la realización de la prueba, ya que puede alterar el resultado del estudio.', N'Act', 1)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (2, N'Ecocardiograma transtoracico', N'Prueba diagnóstica fundamental porque ofrece una imagen en movimiento del corazón. Mediante ultrasonidos, la ecocardiografía aporta información acerca de la forma, tamaño, función, fuerza del corazón, movimiento y grosor de sus paredes y el funcionamiento de sus válvulas.', N'El paciente deberá acudir al estudio aseado (baño diario) y sin colocación de cremas corporales.
El paciente deberá acudir con ropa cómoda, ya que deberá descubrirse el pecho para la toma del estudio.
De ser posible, el paciente deberá ´resentar receta o resumen clínico del médico tratante donde indique la realización del estudio.', N'Act', 2)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (3, N'Electrocardiograma en esfuerzo', N'Electrocardiograma en esfuerzo', N'El paciente deberá ir en ayuno de 3 a 4 hrs., la ingesta de agua natural es libre de horario.
El paciente no deberá fumar al menos 3 horas previas al estudio.
El paciente no deberá realizar actividad física intensa 12 horas previas al estudio.
El paciente deberá acudir al estudio aseado (baño diario) y sin colocación de cremas corporales.', N'Act', 2)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (4, N'Electrocardiograma en reposo', N'Electrocardiograma en reposo', N'El paciente deberá acudir al estudio aseado (baño diario) y sin colocación de cremas corporales.
El paciente deberá acudir con ropa cómoda, ya que deberá descubrirse el pecho para l toma del estudio.
Únicamente se permitirá el cceso al pciente par la realización del esudio.', N'Act', 2)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (5, N'Holter cardiaco', N'Holter cardiaco', N'EL ESTUDIO SÓLO PODRÁ REALIZARSE A PACIENTES MAYORES DE 12 AÑOS.
EL PACIENTE DEBERÁ ACUDIR AL ESTUDIO ASEADO (BAÑO DIARIO) Y SIN COLOCACIÓN DE CREMAS CORPORALES.
EL PACIENTE DEBERÁ ACUDIR CON ROPA CÓMODA, YA QUE DEBERÁ DESCUBRIRSE EL PECHO PARA LA TOMA DEL ESTUDIO.', N'Act', 2)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (6, N'Densitometria 1 region', N'Densitometria 1 region', N'1. No ingerir suplementos con calcio durante al menos 24 horas antes del examen, su estudio puede verse alterado en los valores, sin ser una contraindicación.
2. Presentarse con ropa tipo pans y suelta, evitando que tengan cierres, cinturones o botones de metal.
3. Evitar llevar joyas y cualquier objeto de metal que pueda interferir con la imagen de rayos x.', N'Act', 4)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (7, N'Densitometria 3 regiones', N'Densitometria 3 regiones', N'1. No ingerir suplementos con calcio durante al menos 24 horas antes del examen, su estudio puede verse alterado en los valores, sin ser una contraindicación.
2. Presentarse con ropa tipo pans y suelta, evitando que tengan cierres, cinturones o botones de metal.
3. Evitar llevar joyas y cualquier objeto de metal que pueda interferir con la imagen de rayos x.', N'Act', 4)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (8, N'Densitometria de cuerpo completo', N'Densitometria de cuerpo completo', N'No ingerir suplementos con calcio durante al menos 24 horas antes del examen, su estudio puede verse alterado en los valores, sin ser una contraindicación, solo hay que anotarlo en observaciones.', N'Act', 4)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (9, N'Endoscopia colonoscopia', N'Endoscopia colonoscopia', N'1. Deberá de ingerir sólo líquidos claros durante todo el día (desde el amanecer) té, jugo transparente, gelatina de agua (no de color rojo); no néctar, no jugos crudos o licuados, no lácteos o derivados
2.Podrá ingerir consomé hasta las 22hrs. Después ayuno completo.', N'Act', 5)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (10, N'Phmetria', N'Phmetria', N'1.- CINCO días antes del estudio suspender medicamentos del área de gastroenterología (omeprazol y sus derivados, unival, unamol, riopan, pemix, melox, pepsane).
2.- El dia del estudio no ingerir ningún tipo de medicamento.
3.- Presentarse con 8 o 10 hrs. de ayuno
4.- Ropa cómoda', N'Act', 5)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (11, N'Espirometria con broncodilatador', N'Espirometria con broncodilatador', N'1.- Preescrito por el médico tratante. 
2.- Inhalados como Ventolin o Combivent, ya que son medicamentos que tienen un efecto broncodilatador inmediato. 
3.- Nosotros no limitados los medicamentos, más son los que la Especialista - Neumóloga considera más seguros y confiables para usar dentro de las instalaciones de LMP. ', N'Act', 6)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (12, N'Mastografia', N'Mastografia', N'1. Verificar que la paciente sea mayor de 35 años, si es menor tendrá que presentar receta ORIGINAL que debe incluir: Nombre del medico, nombre de la paciente, cedula profesional, firma del medico y fecha.
2. Aseo general (baño).
3. No aplicar ninguna sustancia sobre la piel de la cintura hacia arriba (desodorante, crema, talco, perfume, pomadas, etc.)', N'Act', 7)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (13, N'Cono de compresion para mastografia', N'Cono de compresion para mastografia', N'1. Verificar que la paciente sea mayor de 35 años, si es menor tendrá que presentar receta ORIGINAL que debe incluir: Nombre del medico, nombre de la paciente, cedula profesional, firma del medico y fecha.
2. Aseo general (baño).
3. No aplicar ninguna substancia sobre la piel de la cintura hacia arriba (desodorante, crema, talco, perfume, pomadas, etc.)
4. La depilación axilar es opcional.', N'Act', 7)
INSERT [dbo].[Analisis] ([AnalisisId], [Nombre], [Descripcion], [Requisitos], [Estatus], [EstudioId]) VALUES (14, N'Perfil biofisico', N'Perfil biofisico', N'Ningúno', N'Act', 9)
